import './styles/Backgroundvideo.css';
import video from './Assets/bgvid.860475ab.mp4';

const Backgroundvideo = () => {
    return (
        <video id="background-video" autoPlay loop>
            <source src={video} type="video/mp4">
            </source>
        </video>
    )
}

export default Backgroundvideo
